import axios from 'axios'
import http from './http_common'

const getAll = () => {
    return http.get("/creategroup/")
}

const createRequire = (member,group_name) => {
    return http.post("/creategroup/", {
        member,
        group_name
    }) //may be edit later
}


export default {
    getAll,
    createRequire,
}
